const CreateTicket = () => {
  return (
    <div>
      <h1>Create a Ticket</h1>
      <form>
        <div className="form-group">
          <label>Title</label>
          <input></input>
        </div>
        <div className="form-group">
          <label>Price</label>
          <input></input>
        </div>
        <button className="btn btn-primary">Submit</button>
      </form>
    </div>
  );
}

export default CreateTicket;
